import { useEffect, useState } from "react"
import { Button, Input } from "../../components";
import { useSelector } from "react-redux";
import homeIcon from "../../icons/home.svg"
import settingsIcon from "../../icons/settings.svg"


export const LeftDashboard = () => {

    const [profilePic, setProfilePic] = useState();

    const {user} = useSelector((state) => state.auth);

    useEffect(()=>{
        const reArrange = user.pictures.sort(function(a, b) {
            return a.id - b.id;
          });

        setProfilePic(reArrange[0].url)
    }, [])

    return (
        <>
            <div className="nav-sect left w-1/2" style={{border: "1px solid black"}}>
                <div className="grid grid-cols-5 gap-1" style={{backgroundColor: "#7B61FF"}}>

                        <div style={{border: "2px red black", textAlign:"center", justifyContent:"center", height: "65px"}}>
                            {/* <div style={{borderRadius: "50%", height: "40px", width: "40px", backgroundColor: "#7B61FF"}}></div> */}
                            <img style={{ borderRadius: "50%", height: "55px", width: "55px"}} src={profilePic} alt="home" /> 
                        </div>
                        <div style={{border: "2px red black", textAlign:"center", justifyContent:"center", height: "65px"}}>
                            <div style={{borderRadius: "50%", height: "40px", width: "40px", backgroundColor: "#7B61FF"}}>{user.firstName}</div>
                        </div>
                        {/* <div style={{border: "2px red black", textAlign:"center", justifyContent:"center", height: "65px"}}>
                            <div style={{borderRadius: "50%", height: "40px", width: "10px", backgroundColor: "#7B61FF"}}></div>
                        </div> */}

                            <div style={{border: "2px red black", textAlign:"center", justifyContent:"center", height: "65px"}}>
                            <img style={{ height: "25px", width: "25px"}} src={homeIcon} alt="home" /> 
                                {/* <div style={{borderRadius: "50%", height: "40px", width: "40px", backgroundColor: "#7B61FF"}}></div> */}
                            </div>
                            <div style={{border: "2px red black", textAlign:"center", justifyContent:"center", height: "65px"}}>
                                {/* <div style={{borderRadius: "50%", height: "40px", width: "40px", backgroundColor: "#7B61FF"}}></div> */}
                            <img style={{ height: "25px", width: "25px"}} src={settingsIcon} alt="home" /> 
                            </div>
                            <div style={{border: "2px red black", textAlign:"center", justifyContent:"center", height: "65px"}}>
                                {/* <div style={{borderRadius: "50%", height: "40px", width: "40px", backgroundColor: "#7B61FF"}}></div> */}
                            <img style={{ height: "25px", width: "25px"}} src={settingsIcon} alt="home" /> 
                            </div>

                </div>

            </div>

        </>
    )
}
